function whathehellomisc(encryptedText, key) {
    let decryptedText = "";
    key = key.toLowerCase(); 
    for (let i = 0; i < encryptedText.length; i++) {
        const charCode = encryptedText.charCodeAt(i);
        const keyCode = key.charCodeAt(i % key.length) - 97; 
        if (charCode >= 65 && charCode <= 90) { 
            decryptedText += String.fromCharCode(((charCode - 65 - keyCode + 26) % 26) + 65);
        } else if (charCode >= 97 && charCode <= 122) { 
            decryptedText += String.fromCharCode(((charCode - 97 - keyCode + 26) % 26) + 97);
        } else {
            decryptedText += encryptedText[i];
        }
    }
    return decryptedText;
}

